INSERT INTO programs (name, description, energy, number_of_meals, price_min) VALUES
  ('EXPRESS FIT','Линейка Express Fit — это сбалансированная ускоренная программа питания, которая направлена на тех, кто хочет похудеть, а также поддерживать достигнутый результат','800','3','761'),
  ('SuperFIt','Super Fit - это низкокалорийная линейка питания, которая позволит в минимальные сроки достичь максимальных результатов','1000','4','778'),
  ('FIT','Линейка Fit — это сбалансированная программа питания, которая направлена на тех, кто хочет похудеть, а также поддерживать достигнутый результат','1200','5','850'),
  ('mFit', 'Линейка MFit — это программа питания, подходящая для комфортного похудения мужчинам, а также в качестве ежедневного рациона поддержания формы женщинам, ведущим активный образ жизни','1600','5','842'),
  ('DAILY','Линейка Daily — это полноценное 4-х разовое питание, которое идеально подойдет тем, кто хочет питаться вкусно и полезно каждый день','1400','4','731'),
  ('BRAKFAST','Линейка Breakfast — это завтраки, которые идеально подойдут тем, кто хочет завтракать вкусно и полезно каждый день','600','2','352'),
  ('BALANCE','Линейка Balance рассчитана на людей, занимающихся спортом. Оптимальное соотношение жиров, белков и углеводов способствует поддержанию спортивной формы','1800','5','910'),
  ('POWER','Линейка Power предназначена для профессиональных спортсменов, основной целью которых является набор мышечной массы','2500','6','978');
